  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains color (RGB) and
  Near Infrared ortho-rectified mosaic tiles, created as a product from the NOAA Integrated
  Ocean and Coastal Mapping (IOCM) initiative. The source imagery was acquired from
  20100907 - 20110918. The images were acquired with an Applanix Digital Sensor System
  (DSS). Ortho-rectified mosaic tiles are an ancillary product of NOAA's Coastal Mapping
  Program (CMP), created through a wider Integrated Ocean and Coastal Mapping initiative
  to increase support for multiple uses of the data. The ground sample distance (GSD)
  for each pixel is 0.50 m.nnData are in Geotiff (.tif) format with associated browse
  graphics and metadata in Federal Geographic Data Committee (FGDC) format.\",\n\t\"owner_org\":
